// dependancies
import { Canvas, useFrame } from '@react-three/fiber'
import { useRef, useState } from 'react'
import { useLoader } from '@react-three/fiber'
import { GLTFLoader } from 'three/examples/jsm/loaders/GLTFLoader'
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

// components
import Skullboard from "./components/skullboard/index"
import Navbar from "./components/navbar/Navbar"
import Test from "./components/testBackground"
import Button from "./components/button/index"
import './App.css';
import BackgroundShapes from './components/backgroundShapes';



function App() {


  return (
    <div>
      <BackgroundShapes />
      <Router>
        <div className="flex-column" style={{zIndex: "100"}}>
          <Navbar />
          <Routes>
            <Route exact path="/portfolio" element="<h1>portfolio</h1>" />

            <Route exact path="/contact" element="<h1>contact</h1>" />

            <Route exact path="/" element={<Skullboard />} />

          </Routes>
        </div>
      </Router>
    </div>
  );
}

export default App;
